import React from "react";
import { Jumbotron } from "react-bootstrap";

const Home = () => (
  <div>
    <Jumbotron>
      <h1>Hello, world!</h1>
      <p>
        Improve your skills and portfolio by coding! You can practice with
        challenges varying in skills. Look at what other people have done and
        submit your own
      </p>
    </Jumbotron>
  </div>
);

export default Home;
